import React from 'react'
import ReactDOM from 'react-dom'

const box = {}

box.width =  '200px'
box.height = '300px'
box.borderRadius = '30px'
box.boxShadow = '10px 10px 20px #000'
box.display = 'flex'
box.justifyContent = 'center'
box.fontFamily = 'Sriracha'

const link = 'https://picsum.photos/200/200'

const img_div = {}
let dim = '70px'
img_div.width = dim
img_div.height = dim
img_div.borderRadius = dim
img_div.marginTop = dim/10



ReactDOM.render(
  <div style={box}>
    <img  className = "img-div" src ={link}  alt={link} style={img_div}/>
  </div>,
  document.getElementById('root')
)
